import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Main from "./components/pages/Main";
import NewThing from "./components/pages/NewThing";
import OTTonly from "./components/pages/OTTonly";
import WeeksLeft from "./components/pages/WeeksLeft";

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/" element={<NewThing />} />
          <Route path="/" element={<WeeksLeft />} />
          <Route path="/" element={<OTTonly />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
